import React from 'react';
import Passcode from './components/Passcode';
import './App.css';

function App() {
  const handlePasscodeValid = () => { // handle when passcode valid
    window.location.href = '/login';
  }

  return (
    <div className="App">
      <Passcode onPasscodeValid={handlePasscodeValid} />
    </div>
  );
}

export default App;
